import React from 'react'
import Card from '../card/card'
import './cards'

const cards = ({info}) => {
  return (
    <div>
        {
            info.map((user)=> <Card nombre={user.nombre} numero={user.numero}/>)
        }
    </div>
  )
}

export default cards
